import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from 'react'

function App() {

  const[msg, setMsg] = useState("");

  useEffect(() => {
    fetch("http://127.0.0.1:5000/api/hello")
    .then(response => response.json())
    .then(data => {
      setMsg(data.message);
    })
    .catch(error => {
      console.error("Error fecthing from Flask API: ", error)
    })
  }, [])

  return (
    <div className='text-center p-4 mt-10'>
      <h1 className='text-3xl'>React + Flask Test</h1>
      <p className='pt-2'>Message from backend: {msg}</p>
    </div>
  )
}

export default App;
